import CustomButton from "../../../components/UI/CustomButton/CustomButton";

function KitchenPreview() {
    return (
        <div className="bg-brown_primary-dark w-full h-auto text-white text-center ">
            <h1 className="text-8xl font-light">Горячие блюда</h1>
            <h2 className="text-4xl font-extralight">Разные виды закусок, напитков</h2>
            <h3 className="text-2xl font-thin">Шашлык, люля-кебаб
                и многое другое</h3>
            <CustomButton to='/kitchen' text='Подробнее' />
        </div>
    );
}

export default KitchenPreview;
